function IntroduceWeb() {
    return(
        <div className="containers">
            <div>
                불필요한 칼로리나 지질을 억제하고 몸에 흡수되기 쉬운 형태인 프로틴처럼
                학습에서 불필요한 것들을 억제하고 쉽게 학습 내용을 흡수할 수 있도록 돕는
                서비스를 의미합니다.
            </div>
            {/* <img /> */}
        </div>
    )
}

export default IntroduceWeb;
